import '../styles/Map.css'
import { useState, useEffect, useRef, CSSProperties } from 'react'

interface IViewBox {x: number,y: number,w: number ,h: number}

const MAX_ZOOM = 6
const MIN_ZOOM = 1
const mouseOrigin = {x: 0, y: 0}

export default function Map() {
	let zoom = 1
	let mousedown = false

	const [mapStyle, setMapStyle] = useState<CSSProperties>({
		transform: 'scale(1)'
	})

	const [viewBox, setViewBox] = useState<IViewBox>({x: 0, y: 0, w: 1355, h: 857})

	const mapRef = useRef(null)

	useEffect(() =>{
		window.addEventListener('wheel', e => {
			const direction = (e.deltaY < 0) ? 1 : -1
			console.log(zoom)
			if(zoom > MAX_ZOOM) {
				zoom = zoom - 0.01
				return
			}
			if(zoom < MIN_ZOOM) {
				zoom = zoom + 0.01
				return
			}
			zoom = zoom + direction * 0.1
			setMapStyle({
				transform: `scale(${zoom})`})
		})

		const handleMousedown = (e: MouseEvent) => {
			mousedown = true
			mouseOrigin.x = e.clientX
			mouseOrigin.y = e.clientY
		}

		const handleMouseup = () => {
			mousedown = false
		}
		
		const handleMouseMove = (e: MouseEvent) => {
			// mouse move
			if(!mousedown){
				return
			}

			const mousePos = {
				x: viewBox.x - (e.clientX - mouseOrigin.x),
				y: viewBox.y -  (e.clientY - mouseOrigin.y)
			}
			console.log(mousePos.x)
			console.log(viewBox.x)
			setViewBox({
				x: mousePos.x,
				y: mousePos.y,
				w: viewBox.w,
				h: viewBox.h})
		}

		window.addEventListener('mousemove', handleMouseMove)
		window.addEventListener('mouseup', handleMouseup)
		window.addEventListener('mousedown', handleMousedown)

		return () =>{
			window.removeEventListener('mousemove', handleMouseMove)
			window.removeEventListener('mouseup', handleMouseMove)
			window.removeEventListener('mousedown', handleMousedown)
		}
	},[viewBox])
	
	return (
		<>
			<svg
				style={mapStyle}
				className='map'
				ref={mapRef}
				viewBox={viewBoxToString(viewBox)}
				fill="none"
				xmlns="http://www.w3.org/2000/svg"
			>
				{MapSVG()}
			</svg>
		</>
	)
}

function viewBoxToString(viewBox: IViewBox): string {
	return `${viewBox.x} ${viewBox.y} ${viewBox.w} ${viewBox.h}`
}

